import { Component, OnInit } from '@angular/core';
import { HttpCommonService } from 'src/app/services/app-http-service';
import { User } from '../user';
import { QueryParameter } from 'src/app/models/query-parameter';
import { ActivatedRoute } from '@angular/router';
import { CommonService } from 'src/app/services/common.service';
import { SystemParameterEnum } from 'src/app/Enums/system-parameters.enum';
import { TipoDocumentoEnum } from 'src/app/Enums/tipo-documento.enum';

@Component({
  selector: 'app-update-user',
  templateUrl: './update-user.component.html',
  styleUrls: ['./update-user.component.scss']
})
export class UpdateUserComponent implements OnInit {

  public model: User;
  public replayPassWord: string;
  public isNew: boolean;
  public title: string;
  public titleButton: string;
  public parameters: QueryParameter[];
  private rotaAnterior: string;
  public sexoOptions: string[];
  public estadoCivilOptions: string[];

  public documentTypes = Object.values(TipoDocumentoEnum).filter(c => typeof(c) == 'string');
  public documentTypesString: string[] = [];

  public constructor(
    private service: HttpCommonService,
    private router: ActivatedRoute,
    private commonService: CommonService
  ) { }

  public ngOnInit(): void {
    this.initializeComponent();
    this.router.paramMap.subscribe((params) => {
      if (!this.commonService.isNullOrUndefined(params.get('id')) && params.get('id') !== '') {
        this.isNew = false;
        this.title = 'Editar usuários';
        this.titleButton = this.title.split(' ')[0];
        this.parameters = [
          {parameter: 'userId', value: params.get('id')}
        ];
        this.service.getSingle('cadastros_url', 'user/getbyid', this.parameters)
          .toPromise()
          .then(c => {
            this.model = c;
            this.model.tipoDocumento = this.ReturnDPcumentType(this.model.tipoDocumento);
            this.model.sexo = this.ReturnSexoDescription(this.model.sexo);
            this.model.estadoCivil = this.ReturnEstadoCivilDescription(this.model.estadoCivil);
            this.replayPassWord = this.model.senha;
            this.model.dataNascimento = this.model.dataNascimento.toString().split("T")[0];
          })
          .catch(e => {
            this.commonService.responseActionWithNavigation(this.rotaAnterior, 'Houve um erro buscar o usuário.', false);
          });
      } else {
        this.isNew = true;
        this.title = 'Cadastrar usuários';
        this.titleButton = this.title.split(' ')[0] === 'Cadastrar' ? 'Salvar' : '';
        this.model.ativo = true;
      }
    });
  }

  // tslint:disable-next-line:use-life-cycle-interface
  public ngOnDestroy(): void {
    this.destroyComponent();
  }

  private initializeComponent(): void {
    this.model = new User();
    this.replayPassWord = '';
    this.sexoOptions = ['Masculino', 'Feminino', 'Outros'];
    this.estadoCivilOptions = ['Solteiro(a)', 'Casado(a)', 'Outros'];
    this.isNew = false;
    this.rotaAnterior = './cadastros/test';
    this.parameters = [];
    this.title = '';
    this.model.ativo = true;
    this.model.bloqueado = true;
  }

  private destroyComponent(): void {
    this.model = null;
    this.isNew = null;
    this.rotaAnterior = null;
    this.parameters = null;
    this.title = null;
  }

  public async incluir() {
    this.model.estadoCivil = this.ReturnEstadoCivil(this.model.estadoCivil);
    this.model.sexo = this.ReturnSexo(this.model.sexo);
    this.model.tipoDocumento = this.ReturnDocumentType(this.model.tipoDocumento);
    if (this.isNew) {
      this.model.usuarioInclusaoId = new SystemParameterEnum().systemUser;
      this.model.dataInclusao = new Date();
      // this.model.dataUltimaAlteracao = new Date();
      this.service.insert('cadastros_url', 'user', this.model)
        .toPromise()
        .then(c => {
          this.commonService.responseActionWithNavigation(this.rotaAnterior, 'Usuário incluido com sucesso.', true);
        })
        .catch(e => {
          this.commonService.responseActionWithNavigation(this.rotaAnterior, e.error, false);
        });
    } else {
      this.model.usuarioUltimaAlteracaoId = new SystemParameterEnum().systemUser;
      this.model.dataUltimaAlteracao = new Date();
      this.service.edit('cadastros_url', 'user', this.model)
        .toPromise()
        .then(c => {
          this.commonService.responseActionWithNavigation(this.rotaAnterior, 'Usuário editado com sucesso.', true);
        })
        .catch(e => {
          this.commonService.responseActionWithNavigation(this.rotaAnterior, e.error, false);
        });
    }
  }

  public navigateToBack() {
    this.commonService.NavigateOnly(this.rotaAnterior);
  }

  private ReturnSexo(value: string) : string {
    if (value === 'Masculino') {
      return 'M';
    } else if (value === 'Feminino') {
      return 'F';
    } else {
      return 'O';
    }
  }

  private ReturnEstadoCivil(value: string) : string {
    if (value === 'Solteiro(a)') {
      return 'ST';
    } else if (value === 'Casado(a)') {
      return 'CS';
    } else {
      return 'OT';
    }
  }

  private ReturnDocumentType(value) : TipoDocumentoEnum {
    if (value === 'RG') {
      return TipoDocumentoEnum.RG;
    }
    else if (value === 'CNPJ') {
      return TipoDocumentoEnum.CNPJ;
    }
    else {
      return TipoDocumentoEnum.CPF;
    }
  }

  private ReturnDPcumentType(value) : string {
    if (value == TipoDocumentoEnum.RG) {
      return "RG";
    } else if (value == TipoDocumentoEnum.CPF) {
      return "CPF";
    } else if (value == TipoDocumentoEnum.CPF) {
      return "CNPJ";
    }
  }

  private ReturnEstadoCivilDescription(value: String): string {
    if (value.toUpperCase() === 'ST') {
      return 'Solteiro(a)';
    } else if (value.toUpperCase() == 'CS') {
      return 'Casado(a)';
    } else {
      return "Outros";
    }
  }

  private ReturnSexoDescription(value: String): string {
    if (value.toUpperCase() === 'F') {
      return 'Feminino';
    } else if (value.toUpperCase() == 'M') {
      return 'Masculino';
    } else {
      return "Outros";
    }
  }
}
<div class="col-md-12 col-lg-12 mb-4 align-items-stretch">
    <app-comp-title [title]="this.title"></app-comp-title>
      <div class="card border-0 rounded-0 h-100">
        <div class="card-body">
          <form>
            <div class="form-group">
              <label for="exampleInputNome">Nome</label>
              <input maxlength="100" type="text" class="form-control rounded-0"
                placeholder="Informe o Nome" [(ngModel)]="this.model.nome" [ngModelOptions]="{ standalone: true }"/>
              <small id="nome" class="form-text text-muted">Informe um nome para o cadastro.</small>
            </div>

            <div class="form-group">
                <label for="exampleInputUserName">Nome de usuário</label>
                <input maxlength="50" type="text" class="form-control rounded-0"
                  placeholder="Informe o Nome de usuário" [(ngModel)]="this.model.userName" [ngModelOptions]="{ standalone: true }"/>
                <small id="UserName" class="form-text text-muted">Informe um nome de usuario para o cadastro.</small>
            </div>

            <div class="form-group">
                <label for="exampleInputEmail">Email</label>
                <input maxlength="255" type="email" class="form-control rounded-0"
                  placeholder="Informe o Email" [(ngModel)]="this.model.email" [ngModelOptions]="{ standalone: true }"/>
                <small id="email" class="form-text text-muted">Informe um email para o cadastro.</small>
            </div>

            <div class="form-group">
              <label for="exampleInputDataNascimento">Data de nascimento</label>
              <input type="date" class="form-control rounded-0"
                placeholder="Informe a Data de Nascimento" [(ngModel)]="this.model.dataNascimento" [ngModelOptions]="{ standalone: true }"/>
              <small id="dataNascimento" class="form-text text-muted">Informe a data de nascimento para o cadastro.</small>
            </div>

            <div class="form-group">
                <label for="exampleInputDocumentType">Tipo do documento</label>
                <select [(ngModel)]="this.model.tipoDocumento" [ngModelOptions]="{ standalone: true }" class="custom-select" name="state_raw" id="state_raw" required>
                    <option [value]="undefined" selected>Selecione...</option>
                    <option [value]="documentType" *ngFor="let documentType of this.documentTypes"> {{ documentType }}</option>
                </select>
                <small id="DocumentType" class="form-text text-muted">Informe o tipo do documento para o cadastro.</small>
            </div>

            <div class="form-group">
                <label for="exampleInputDocument">Numero o número documento</label>
                <input maxlength="50" type="text" class="form-control rounded-0"
                  placeholder="Informe o número de documento" [(ngModel)]="this.model.nmrDocumento" [ngModelOptions]="{ standalone: true }"/>
                <small id="email" class="form-text text-muted">Informe um número de documento para o cadastro.</small>
            </div>

            <div class="form-group">
              <label for="formControlSexo">Sexo</label>
              <select [(ngModel)]="this.model.sexo" [ngModelOptions]="{ standalone: true }" class="form-control rounded-0" id="formControlSexo">
                <option [value]="undefined" selected>Selecione...</option>
                <option [value]="sexoOption" *ngFor="let sexoOption of this.sexoOptions"> {{ sexoOption }}</option>
              </select>
              <small id="sexo" class="form-text text-muted">Informe o sexo para o cadastro.</small>
            </div>

            <div class="form-group">
              <label for="formControlEstadoCivil">Estado Civil</label>
              <select [(ngModel)]="this.model.estadoCivil" [ngModelOptions]="{ standalone: true }" class="form-control rounded-0" id="formControlEstadoCivil">
                <option [value]="undefined" selected>Selecione...</option>
                <option [value]="estadoCivil" *ngFor="let estadoCivil of this.estadoCivilOptions"> {{ estadoCivil }}</option>
              </select>
              <small id="estadoCivil" class="form-text text-muted">Informe o estado civil para o cadastro.</small>
            </div>

            <div class="form-group">
              <label for="exampleInputNmrTelefone">Informar o número do telefone</label>
              <input maxlength="14" type="text" class="form-control rounded-0" mask="(00)00000-0000"
                placeholder="Informe o telefone" [(ngModel)]="this.model.nmrTelefone" [ngModelOptions]="{ standalone: true }"/>
              <small id="NmrTelefone" class="form-text text-muted">Informe o número do telefone para o cadastro.</small>
            </div>

            <div class="form-group">
              <label for="exampleInputPassword">Informar a senha</label>
              <input maxlength="50" type="password" class="form-control rounded-0"
                placeholder="Informe a senha" [(ngModel)]="this.model.senha" [ngModelOptions]="{ standalone: true }"/>
              <small id="password" class="form-text text-muted">Informe uma senha para o cadastro.</small>
            </div>

            <div class="form-group">
                <label for="exampleInputReplayPassword">Confirmar senha</label>
                <input maxlength="50" type="password" class="form-control rounded-0"
                  placeholder="Informe a senha" [(ngModel)]="this.replayPassWord" [ngModelOptions]="{ standalone: true }"/>
                <small id="password" class="form-text text-muted">Informe a senha novamente para o cadastro.</small>
            </div>

            <div class="custom-control custom-checkbox my-1 mr-sm-2 mb-3">
              <input type="checkbox" class="custom-control-input"
                id="customControlAtivo" [(ngModel)]="this.model.ativo" [ngModelOptions]="{ standalone: true }" />
              <label class="custom-control-label" for="customControlAtivo">Ativo</label>
            </div>

            <button type="button" class="btn btn-lightning rounded-0 mb-2 mr-2" (click)="incluir()">
              {{this.titleButton}}
            </button>
            <button type="button" class="btn btn-outline-lightning rounded-0 mb-2" (click)="navigateToBack()">
              Cancelar
            </button>
          </form>
        </div>
    </div>
</div>
